姿态，一起追爱吧！Young Lovers 凭2月14日当天消费满288元购物小票即可报名参加追爱总动员趣味游戏，参赛者在起跑线背起情侣搭档，在2分钟内于规定路线按规定指令完成比赛，即可赢得朝阳大悦城准备的惊喜情侣大奖??iPod Shuffle。足足30台的iPodShuffle，亲们，赶紧携伴前来吧。\r\n“浓情蜜意??Youare my Valentine”会员专场\r\n2月14日当天，朝阳大悦城也为其会员精心准备了“浓情蜜意??You are my Valentine”的专场活动，以会员情人节积分兑换和会员JOY CLASS第一堂课??烘焙乐趣之“巴黎贝甜的水果甜心”为主。\r\n在会员积分兑换的活动中，朝阳大悦城会员消减一定积分即可兑换相应的甜蜜“礼品”，为自己和爱人的2月14日准备一份意想不到的惊喜。Marc Jacobs Honey女士香氛、歌帝梵松露形巧克力礼盒、Lovely Lace的泰迪熊、撤思叔叔经典芝士蛋糕等精美礼品，等着会员们的甜蜜兑换。\r\n','2014-02-11 00:00:00','2014-02-24 00:00:00',NULL,1,14,'632660BAB84E4F8D81E755CCBE7E7F9B',NULL,NULL,NULL,NULL),(15,5,'朝阳大悦城2013全球跨年狂欢夜',NULL,'attachment/2014-02-17/20140217162948946965.jpg','2013年12月31日，朝阳大悦城携手FM 900音乐之声（ MusicRadio）共同举办“2013全球跨年狂欢夜”，当晚将邀请来自全球五大洲的\r\n风情表演打造视觉盛宴，大西洋热舞、西班牙斗牛舞、美洲桑巴、非洲土著舞蹈、亚洲劲舞，美轮美奂的彩妆，华丽缤纷的舞服和无可挑剔的表演将跨年狂欢推向极致！\r\n 同时MusicRadio还将带来多位当红艺人与消费者互动，情歌王子陈楚生更将倾情献唱，并和观众们一起HIGH到凌晨参加跨年倒数迎接活动。\r\n','2013-12-24 00:00:00','2014-03-01 00:00:00',NULL,1,16,'C3C6A1EEF1664E9083DBF0CBB206FD35',NULL,NULL,NULL,NULL),(16,9,'“美丽绽放”买赠活动','attachment/2014-02-20/20140220103330441196.jpg','attachment/2014-02-20/20140220103330441196.jpg','蓝色港湾让你“美丽绽放”！即日起至2月14日，凡在蓝色港湾指定品牌消费满800元，即送200元贵宾礼券！每日限量150张，先到先得，赠完为止哦！详询电话：59056668\r\n活动时间：2014年1月20日至2014年2月14日\r\n礼品领取地点：MALL M层中庭服务台\r\n活动细则：\r\n1. 本活动仅限当日蓝色港湾MALL二层指定商户消费小票：\r\nEP雅莹、凡释、M2、茜比、娇鼎、sefon、Lavinia、oudifu、DUNNU、水润天青、TR/BECA、Alerry、HUI\r\n2. 单张小票每满800元即送200元礼券，每张小票最多可送20张礼券，超出金额部分不可拆分，不用于累计；当日同一店铺满足条件的多张小票最多可兑换20张；\r\n3. 礼券每日限150张，数量有限，先到先得，赠完为止；\r\n4. 顾客退货时，需退还相应礼券，礼券无法退还时，需缴纳相应礼券金额；\r\n5. 蓝色港湾工作人员及导购恕不参加此次活动；\r\n6. 蓝色港湾拥有变更、调整、终止本活动的权利；\r\n7. 活动详询：59056663/6668。 ','2014-01-20 00:00:00','2014-03-22 00:00:00',NULL,1,17,'EBE6B5478EAC4B4DAE88C47F262170BE',NULL,NULL,NULL,NULL),(17,9,'试试','attachment\\2014-02-25\\20140225090815406271.jpg','attachment\\2014-02-25\\20140225090815406170.jpg','撒的范德萨发','2014-02-23 00:00:00','2014-02-23 00:00:00',NULL,1,15,'50BE77C7144B4B599634D70CDCFF9065',NULL,NULL,NULL,0);

/*Table structure for table `com_mcard` */

DROP TABLE IF EXISTS `com_mcard`;

CREATE TABLE `com_mcard` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `card_id` varchar(30) DEFAULT NULL COMMENT '会员卡号',
  `type` tinyint(4) DEFAULT NULL COMMENT '会员卡类型，1:IGO系统会员卡,2:商场会员卡',
  `mall_uuid` varchar(32) DEFAULT NULL COMMENT '会员卡类型如果是商场类型，该字段关联会员卡和商场 \r\n',
  `create_time` datetime DEFAULT NULL,
  `score` int(11) DEFAULT NULL,
  `customer_id` int(11) DEFAULT NULL COMMENT '会员卡关联到的会员id',
  `is_del` tinyint(1) DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COMMENT='会员卡信息，包括IGO系统会员卡和商场会员卡';

