,NULL,'01085626583',NULL,NULL,NULL,'鼎泰丰的传奇在于将中国个性化美食传到了世界，无论在哪里都备受欢迎。\r\n5克的皮，16克馅，18个褶，多个褶会厚，少个褶会薄，均匀美观.','attachment/2013-12-25/20131225104051088668.jpg','attachment/2013-12-25/20131225104100663119.jpg',NULL,80,81,'F666C500B9624229BFB46803B633FA5A',3,1,NULL,NULL,NULL,4.5,1,NULL,NULL,NULL,1,NULL,NULL,NULL,NULL,0),(41,'H&M',NULL,NULL,'','店小二','0103231233',NULL,NULL,NULL,'Hennes&MauritzAB的简称，由ErlingPersson于1947年在瑞典创立， 一个将时尚、品质完美糅合的时尚品牌。','attachment/2014-02-10/20140210154205770609.jpg','attachment/2014-02-10/20140210154205770951.jpg',NULL,NULL,NULL,'1BE8F64155294DF797E850C7B40A99E4',42,1,'H&M','1','',5.0,1,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,1),(42,'sdf',NULL,NULL,'','sfd','sdf',NULL,NULL,NULL,'sfd','attachment/2014-02-17/20140217170817383109.jpg','attachment/2014-02-17/20140217170817384225.jpg',NULL,NULL,NULL,'AA51379F2F4B423CB5F295BB63F52AFD',1,6,'asd','-1','s',NULL,1,NULL,'sd',NULL,NULL,NULL,NULL,NULL,NULL,1),(43,'sdf',NULL,NULL,'','asdf','asdf',NULL,NULL,NULL,'safd','attachment/2014-02-17/20140217180501915386.jpg','attachment/2014-02-17/20140217180501917129.jpg',NULL,NULL,NULL,'11942AB190844DD89DE7E3705A61B0C9',43,1,'asdf','-1','',NULL,1,NULL,'safd',NULL,NULL,NULL,NULL,NULL,NULL,1),(44,'永旺超市',NULL,NULL,'','联系人','18689513697',NULL,NULL,NULL,'世界500强永旺集团是日本最大的零售集团，在日本及东南亚地区有综合百货超市606家，食品超市1182家，2008年营业收益达5万亿日元。\r\n永旺朝阳大悦城店是永旺集团以日本独资经营管理方式的商业项目，并带来先进的综合百货超市零售经营模式。\r\n永旺朝阳大悦城店将通过现代化得装饰和陈列，力求将其包装成独特的日式购物场所，同时永旺拟引入众多日本本土品牌，以物超所值的价格为顾客提供日常生活需要的各种商品。\r\n永旺超市面积近10000平米，为周边居民提供新鲜和富有特色的食品，方便社区居民生活。\r\n','attachment/2014-02-17/20140217182027614159.jpg','attachment/2014-02-17/20140217182027615533.jpg',NULL,NULL,NULL,'AD93B0E9117541D68A332FAFDD5AB95E',44,5,'','-1','',NULL,1,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(45,'喜洋洋','喜洋洋',NULL,'','','',NULL,NULL,NULL,'精心设计的职业体验乐园是朝阳大悦城的亮点项目，模拟的70多个职业涵盖了真实社会生活的方方面面，街道、医院、超市、学校、机场等设施无所不包，俨然一座小型的现实社会。踏足职业体验乐园，也就亲身体验变化万千的职业生涯：机场，登机手续独自办；城市中心区域，商业行为及市场轨道交通体验冲撞视野；码头，物流运输繁而有序……感受各种真实的职业体验，为家人打开了一扇通向社会的大门，在增加他们阅历与见识的同时，也为将来的成长及职业选择做了充分准备。','attachment/2014-02-17/20140217184556727475.jpg','attachment/2014-02-17/20140217184556727906.jpg',NULL,NULL,NULL,'D65D52A0A5424CCA9F4D209796CF217D',45,9,'','1000','',NULL,101,16,'',NULL,NULL,NULL,NULL,NULL,NULL,1),(46,'冠军滑冰','冠军滑冰',NULL,'','','',NULL,NULL,NULL,'  符合国际标准的冠军滑冰场，可以举行花样滑冰、速滑、冰球等各种冰上项目，空中冰场以其独特的“艺术溜冰”理念，通过运动、休闲、娱乐及滑冰培训为消费者构建一个多元化一站式的滑冰世界。在这里，每位观众都是冰雪世界的体验者，每位滑冰者都是舞台的主角，而世界冠军及国家级教练员组成的高水平优秀教练员团队，又将每位滑冰爱好者直接带入世界级竞技殿堂，无限精彩无限荣耀由此迸发。','attachment/2014-02-17/20140217184800449108.jpg','attachment/2014-02-17/20140217184800449242.jpg',NULL,NULL,NULL,'2E50E9A2BDB54E6CA78C50D5720F063B',46,5,'','1000','',NULL,17,22,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(47,'金逸影城','金逸影城',NULL,'','','',NULL,NULL,NULL,'   现已签约的金逸影院按照国际影院最高标准，采用国际最先进的音响设备和影视系统，超大的整壁式清晰银幕置身于影厅中，全方位立体声音波无处不在，让观众享受到逼真而震撼的视听效果，感受非同?般的梦幻体验。影院采用8~9层跨层设计，面积达4500平方米，拥有8个豪华电影厅，总座位数超过1000多个，秉承华纳国际影院的全球风格，装修豪华，气派大方，先进高效的售票系统，残疾人专用无障碍通道，宽大舒适的沙发式座椅，处处都体现着华纳影院的艺术、人文设计和服务的国际理念。','attachment/2014-02-17/20140217185457628387.jpg','attachment/2014-02-17/20140217185457629540.jpg',NULL,NULL,NULL,'A8253A4378B24D71BA53BA9B5FFA5A32',47,5,'','1000','',NULL,17,22,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(48,'大嘴猴',NULL,NULL,'','','59056059',NULL,NULL,NULL,'大嘴猴Paul Homme是和Calvin Klein齐名的国际知名品牌。产品系列：服装、床上用品、睡衣、泳装、内衣、休闲装、苹果配件等等，品牌持有商为Hk Saatchi inc。','attachment/2014-02-19/20140219110542424207.png','attachment/2014-02-19/20140219110542425994.jpg',NULL,NULL,NULL,'502CFAB4073046FFA93DAB1E1F02642E',48,9,'','-1','',NULL,1,NULL,'',1,1,NULL,NULL,NULL,NULL,NULL),(49,'zara',NULL,NULL,'','','59056100 ',NULL,NULL,NULL,'世界第一大服装零售商Inditex集团旗下最大最国际化的时装品牌，在全球70个国家拥有1400多家专卖店。ZARA深受全球时尚青年的喜爱，设计师品牌的优异设计，价格却更为低廉，简单来说就是让平民拥抱High Fashion。在ZARA独具匠心的店铺内，你总是能找到限量供应的潮流新品，体会国际化的购物理念。','attachment/2014-02-19/20140219111344058112.png','attachment/2014-02-19/20140219111344058764.jpg',NULL,NULL,NULL,'4191088365404988BE5DE0C2BDD550E1',49,9,'M层-48','-1','',NULL,1,NULL,'',1,NULL,NULL,NULL,NULL,NULL,NULL),(50,'哈根达斯',NULL,NULL,'','','59056806',NULL,NULL,NULL,'在哈根达斯，人们不仅能品享到甜蜜醇浓的冰淇淋艺术，更能精彩演绎属于自己的醉人篇章。忘掉一切烦恼，远离世俗尘嚣，在哈根达斯的浓情国度里，尽享无与伦比的甜蜜、细腻和幼滑，与所爱的人共赴完美一刻。爱她，就请她吃哈根达斯，也将成为每座城市爱的宣言。','attachment/2014-02-19/20140219123228836117.jpg','attachment/2014-02-19/20140219123228837249.jpg',NULL,NULL,NULL,'983B3C0201D946E5AC70D56416EB1756',50,9,'品牌街W-04','1','',NULL,1,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(51,'I DO',NULL,NULL,'','','59056127',NULL,NULL,NULL,'I Do是HIERSUN(恒信)钻石机构旗下专注于珍贵情感表达的珠宝品牌。','attachment/2014-02-19/20140219124909178132.png','attachment/2014-02-19/20140219124909178305.jpg',NULL,NULL,NULL,'6CA010557AA4431795C6E36A2D300677',51,9,'品牌街W-10','1','',NULL,1,NULL,'',1,1,NULL,NULL,NULL,NULL,NULL),(52,'UGG',NULL,NULL,'','','59056832',NULL,NULL,NULL,'“UGG Australia”美国著名休闲鞋领导品牌，是澳大利亚天然珍贵A级羊毛皮。奢华的选料让羊毛皮的触感犹如丝绸。穿上UGG的鞋就立即感觉到前所未有的舒适，所有商品都经过严格考验来确保最舒适的适合度。当季的时尚款鞋履，搭配个性、时髦的服饰，演绎美国纽约街头风尚。','attachment/2014-02-19/20140219125754808101.jpg','attachment/2014-02-19/20140219125754808720.jpg',NULL,NULL,NULL,'38AD693E65A847BD863F428710B00EB9',52,9,'品牌街w-20','1','',NULL,1,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(53,'乐高',NULL,NULL,'','','59056804',NULL,NULL,NULL,'KIDSLAND坚持“品质至上、快乐传递”的理念，一直在为中国儿童提供真正好品质的玩具，为中国儿童的课余时间带来了无比的快乐。\r\n    目前，Kidsland玩具专营店遍布全国超过30家。在这里，能让您的孩子在玩耍中学习知识，在学习中体验快乐，乐高玩具给你发挥创造和想象的空间，变形金刚的变换和震撼，让你在博派汽车人和狂派的斗争中展开无比的想象；还有来自美国孩之宝的淘气宝贝，让宝宝体验做妈妈的辛苦，帮她（他）喂奶，喝水，换尿布，上厕所。\r\n    除此之外，KIDSLAND店里还有更多让你爱不释手的玩具——车模、动物、玩具拼图……','attachment/2014-02-19/20140219130626921129.jpg','attachment/2014-02-19/20140219130626921850.jpg',NULL,NULL,NULL,'2F36EB90992B41D189622E4CBB210722',53,9,'儿童城2层-01','1','',NULL,1,NULL,'',1,NULL,NULL,NULL,NULL,NULL,NULL),(54,'莎莎',NULL,NULL,'','','59056275',NULL,NULL,NULL,'莎莎为亚洲区内具领导地位的化妆品零售集团，於亚洲区内六个主要市场包括香港丶中国大陆丶新加坡丶马来西亚丶台湾地区及澳门设有逾260间零售店及专柜。\r\n    集团销售逾600个品牌，合共超过17,000种护肤品、香水、化妆品、护发及身体护理产品、美容营养食品，以及集团专有品牌和独家代理的名牌产品。集团的亚洲区零售网络包括逾260间销售多品牌的「莎莎」店铺、2个La Colline科丽妍专门店、7个Suisse Programme瑞士葆丽美专门店/专柜。','attachment/2014-02-19/20140219131453571873.jpg','attachment/2014-02-19/20140219131453571928.jpg',NULL,NULL,NULL,'F579434AA4B24B43B6FA1D596283DDCE',54,9,'M层-40','-1','',NULL,1,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(55,'Harbor House',NULL,NULL,'','','59051718',NULL,NULL,NULL,'Harbor House品牌源于美国加州北部，被太平洋与Mendocino红木森林环绕的Harbor House度假别墅，坐落在宁静的海滩花园上，对望着浩渺无边的大海。 这座由著名设计师Louis Christian Mullgardt设计，始建于1916年的Harbor House以其无可复制的后花园海景、古朴大气的建筑风格、精美的红木艺术，被誉为美国20世纪初Arts and Craft时代最具代表性的建筑之一。\r\n    如今Mendocino海岸早已禁止了任何形式的开发与建筑，自然的生态将被永久的保护下去。 在这里，远离闹市的喧嚣，时间停下了它的脚步。在阳光满满的周末，你可以去海里冲浪；在Harbor House花园后面的海滩戏水；你可以与成群的海鸟为伴，观赏百米外迁游途中的鲸鱼群；你可以潜入神秘的海底森林，去采加州特有的红鲍鱼；你可以去周边浓香四溢的葡萄酒园品酒；你也可以带着家人去附近的红木森林露营，晚上围着暖暖的篝火，一起分享一天的快乐与收获。\r\n    今天，我们把Harbor House的生活方式介绍给我们的客人。 Harbor House的产品，在全球采购, 由顶尖设计师们创造, 但并不为贵重所累. 我们崇尚的是平价的奢华, 以超凡的价值及丰富的产品组合, 带给你完美的购物体验。\r\n    Harbor House是质朴从容的生活, 是人与自然的融合, 是无拘无束的自由。','attachment/2014-02-19/20140219132538592664.png','attachment/2014-02-19/20140219132538592450.jpg',NULL,NULL,NULL,'7DB89CF9B7AE45B7BAD3C1394E3A8546',55,9,'2层-154','1','',NULL,1,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(56,'勒夫马',NULL,NULL,'','','',NULL,NULL,NULL,'Lafuma主张人与自然和谐相处，保护人类赖以生存的自然。Lafuma 是世界上最早与国际环境组织（International Environment Organization）合作，将环保的可再生面料运用到产品中的户外品牌之一。Lafuma标识上凡是带有Pure Leaf字样的产品均引入生态环保理念，从材质的选择到运输过程中的每一个环节均尽可能将二氧化碳的排放量减到最低，这也成为了户外品牌中的经典之作。\r\n从品牌诞生的1930年开始，Lafuma的精髓就是山与自然。Lafuma同善于挑战极限的探险家们一起改写了世界历史的篇章，同时横跨欧洲，感动全世界。其价值远远超出了“户外品牌”本身。','attachment/2014-02-19/20140219134127088326.jpg','attachment/2014-02-19/20140219134127088768.jpg',NULL,NULL,NULL,'4C2E345C17B5432992ACAE90521AD8DD',56,9,'品牌街W-56','1','',NULL,1,NULL,'',1,NULL,NULL,NULL,NULL,NULL,NULL),(57,'卡巴瑞',NULL,NULL,'','','59056123',NULL,NULL,NULL,'CABARE餐厅特色：可供选择的鸡尾酒和葡萄酒精选以及独具创新的欧式菜单。60坐就餐空间可供选择欧式特选餐品、进口新鲜牡蛎、以及各类糕点甜品。同时可以品尝到特色鸡尾酒或尊享精制欧洲小吃。\r\n订座及咨询电话: (8610) 59051760\r\n    电邮： resa@cabare.cn.\r\n    商务午餐: 周一至周五  上午11:30至下午2:30\r\n    餐吧开放时间: 就餐服务 周一至周日 上午9:00至晚上11:00\r\n    酒水服务 周一至周日 上午9:00至凌晨2:30\r\n    晚餐服务: 周一至周五 下午5:00至晚上11:0','attachment/2014-02-19/20140219135145323931.jpg','attachment/2014-02-19/20140219135145323551.jpg',NULL,NULL,NULL,'E5E6FA6F3EF24761B406D6A220F9ED21',57,9,'湖畔美食街-02','-1','',NULL,1,NULL,'',1,1,NULL,NULL,NULL,NULL,NULL),(58,'三星',NULL,NULL,'','','',NULL,NULL,NULL,'三星一直秉承最基本也最简单的经营理念，即以人才和技术为基础，创造出高品质的产品和服务，为人类社会发展做贡献。为实现这一目标，三星在培养员工和创新技术方面都有着较高的标准。','attachment/2014-02-19/20140219140441800900.jpg','attachment/2014-02-19/20140219140441800177.jpg',NULL,NULL,NULL,'C228CFD1EE254CB181D698222B5976B0',58,9,'M层-50','-1','',NULL,1,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(59,'BHG精品',NULL,NULL,'','','59056808  ',NULL,NULL,NULL,'北京华联高级食品超市（BHG Market Place）：BHG Market Place是北京华联针对本土高档消费者及居住在本土的外籍人士开办的高档超市。提供以意、法、日为中心的国际化食品，以及天然无农药公害的蔬菜、水果和来自当地农场的绿叶蔬菜、天然野生海鲜产品、上等肉类、著名厨师现场烹饪的欧洲美食、上选酒品等。超市为顾客提供优雅的购物环境、丰富多彩的商品试用和一应俱全的商品教育。BHG Market Place精英的管理团队和严格的业务培训确保始终如一地向消费者提供最专业的服务，让每一个顾客体会到宾至如归的感觉。','attachment/2014-02-19/20140219141146372123.png','attachment/2014-02-19/20140219141146372458.jpg',NULL,NULL,NULL,'740694214AB2468CB6584C6336D36CEB',59,9,'M层-06','-1','',NULL,1,NULL,'',1,NULL,NULL,NULL,NULL,NULL,NULL),(60,'传奇时城',NULL,NULL,'','','59056868 ',NULL,NULL,NULL,'八厅高端放映影院，拥有着世界最先进的视听设备，还特有家庭或朋友聚会而设的PARTY小厅，让亲朋好友独享光影的魅力。','attachment/2014-02-19/20140219142105293933.jpg','attachment/2014-02-19/20140219142105294994.jpg',NULL,NULL,NULL,'0E941BDB69B14FAF986B8DAA8E982F58',61,9,'品牌街-42','1','',NULL,1,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(61,'Promod',NULL,NULL,'','','010-59056990',NULL,NULL,NULL,'Promod创建于1975年。作为一个法国家族式服装品牌，它一直致力于女性成衣和流行配饰的设计、生产与零售。现已成为世界最大的流行连锁专卖店之一：至今拥有700多家专卖店，遍布世界44个国家，其创建的品牌在全球范围取得了巨大的成功。\r\n2013年10月31日Promod蓝色港湾店重装开业！','attachment/2014-02-22/20140222155336390140.jpg','attachment/2014-02-22/20140222155336391612.jpg',NULL,NULL,NULL,'04242CE324B442788E0F7778905ADB9D',60,9,'W1-97','1','',NULL,1,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(62,'金牌小龙',NULL,NULL,'','龙师傅','13501211096',NULL,NULL,NULL,'“金牌小龙”的小笼包独具风味，是非尝不可的精典佳肴，小包馅品种有金牌鲜肉、蟹黄及大闸蟹，每款都是汁丰味美、皮薄馅多，用筷子夹起，皮薄可透光，不会一夹就散。包子的肉馅只选用猪后腿肉，使口感更Q更滑嫩，并添加用猪皮、大骨、筋腱慢火熬制的特制“胶冻”，含有丰富的胶原蛋白。蟹黄选用全部出自手工剥取的鲜活膏蟹及正宗阳澄湖的大闸蟹，让尊客享受美食的同时美颜强身。在制作上更是讲求形美、味美的精工打造，训练有素的师傅巧手包出的小笼包个个要求一致，面皮每片重5克、直径为6.5厘米、褶数在19褶以上、重量在 21克，要求误差只能在0.2毫克之内，每一颗都是精工雕制，精益求精。\r\n','attachment/2014-02-24/20140224133741756143.jpg','attachment/2014-02-24/20140224133741779941.jpg',NULL,NULL,NULL,'B904652E26C84C38B162AA7C8320AC64',62,1,'',NULL,'',NULL,1,NULL,'金牌小龙世贸天阶店',NULL,NULL,NULL,NULL,NULL,NULL,1),(63,'金牌小笼','金牌小笼',NULL,'','龙师傅','13501211096','123',NULL,NULL,'        金牌小龙”的小笼包独具风味，是非尝不可的精典佳肴。\r\n        小包馅品种有金牌鲜肉、蟹黄及大闸蟹，每款都是汁丰味美、皮薄馅多，用筷子夹起，皮薄可透光，不会一夹就散。\r\n        包子的肉馅只选用猪后腿肉，使口感更Q更滑嫩，并添加用猪皮、大骨、筋腱慢火熬制的特制“胶冻”，含有丰富的胶原蛋白。\r\n        蟹黄选用全部出自手工剥取的鲜活膏蟹及正宗阳澄湖的大闸蟹，让尊客享受美食的同时美颜强身。\r\n        在制作上更是讲求形美、味美的精工打造，训练有素的师傅巧手包出的小笼包个个要求一致，面皮每片重5克、直径为6.5厘米、褶数在19褶以上、重量在 21克，要求误差只能在0.2毫克之内，每一颗都是精工雕制，精益求精。\r\n','attachment/2014-02-24/20140224134020860575.jpg','attachment/2014-02-24/20140224134020860319.jpg',NULL,NULL,NULL,'5FDEFC1895FC45759DF4A6E8937AC0FA',64,9,'','中心MALL F4','',NULL,101,25,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(64,'饭前饭后','饭前饭后',NULL,'','','01064059598',NULL,NULL,NULL,' “饭前也想你，饭后还想你，饭前饭后更想你”\r\n      ——饭前饭后—座落在600年历史文化古迹里，“南新仓”皇家粮仓群，传承历史与现代交错的空间，美食亦是如此。','attachment/2014-02-24/20140224134950217409.jpg','attachment/2014-02-24/20140224134950217903.jpg',NULL,NULL,NULL,'A4A92E11C5DA4F848373D76346E0CC31',63,9,'','中心MALL F5','',NULL,101,22,'饭前饭后更想你',1,1,NULL,NULL,NULL,NULL,NULL),(65,'sdfs',NULL,NULL,'','','',NULL,NULL,NULL,'sfd','attachment\\2014-02-24\\20140224234627843358.jpg','attachment\\2014-02-24\\20140224234627843854.jpg',NULL,NULL,NULL,'E034E75754A44517AF47345C76F014E6',65,9,'','-1','',NULL,1,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,1),(66,'sfdad',NULL,NULL,'','','',NULL,NULL,NULL,'asfd','attachment\\2014-02-24\\20140224234843375120.jpg','attachment\\2014-02-24\\20140224234843375391.jpg',NULL,NULL,NULL,'3CF715F534544511AC2AE6F0D67916FA',66,9,'','-1','',NULL,1,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,1),(67,'sdf',NULL,NULL,'','','',NULL,NULL,NULL,'sfd','attachment\\2014-02-25\\20140225002202875565.jpg','attachment\\2014-02-25\\20