/*Table structure for table `com_shop_class` */

DROP TABLE IF EXISTS `com_shop_class`;

CREATE TABLE `com_shop_class` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `level` int(11) DEFAULT NULL COMMENT '分类级别 1: 一级分类 2:二级分类 3:三级分类',
  `parent_id` int(11) DEFAULT NULL COMMENT '分类父类型 对应 的是  type',
  `name` varchar(32) DEFAULT NULL COMMENT '分类名称',
  `des` varchar(500) DEFAULT NULL COMMENT '分类描述',
  `sort` int(11) DEFAULT NULL COMMENT '排序',
  `is_del` tinyint(1) DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=102 DEFAULT CHARSET=utf8 COMMENT='商户分类';

