/*Table structure for table `sys_help_doc` */

DROP TABLE IF EXISTS `sys_help_doc`;

CREATE TABLE `sys_help_doc` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `doc_content` longtext,
  `doc_desc` varchar(255) DEFAULT NULL,
  `doc_title` varchar(255) DEFAULT NULL,
  `sys_menu` int(11) DEFAULT NULL,
  `last_update_time` datetime DEFAULT NULL,
  `visible` bit(1) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `FK683AC46C1A01940D` (`sys_menu`),
  CONSTRAINT `FK683AC46C1A01940D` FOREIGN KEY (`sys_menu`) REFERENCES `sys_menu` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

