/*Table structure for table `sys_menu` */

DROP TABLE IF EXISTS `sys_menu`;

CREATE TABLE `sys_menu` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `last_update_time` datetime DEFAULT NULL,
  `visible` varchar(1) DEFAULT NULL,
  `authority_name` varchar(128) DEFAULT NULL,
  `enabled` varchar(1) DEFAULT '1',
  `menu_desc` varchar(32) NOT NULL,
  `menu_name` varchar(128) DEFAULT NULL,
  `menu_seq` int(11) DEFAULT NULL,
  `menu_type` varchar(1) NOT NULL,
  `parent_id` int(11) DEFAULT NULL,
  `external` int(11) DEFAULT '0' COMMENT '是否外部(iframe)',
  `target` varchar(16) DEFAULT 'navTab',
  `insert_user` int(11) DEFAULT NULL,
  `last_update_user` int(11) DEFAULT NULL,
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `icon` varchar(50) DEFAULT NULL,
  `summary` varchar(500) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `FK74A4479120C3FD4C` (`parent_id`),
  KEY `FK74A447919F3BD079` (`insert_user`),
  KEY `FK74A447911DCD6440` (`last_update_user`),
  CONSTRAINT `FK74A447911DCD6440` FOREIGN KEY (`last_update_user`) REFERENCES `sys_user` (`id`),
  CONSTRAINT `FK74A447919F3BD079` FOREIGN KEY (`insert_user`) REFERENCES `sys_user` (`id`),
  CONSTRAINT `sys_menu_ibfk_1` FOREIGN KEY (`parent_id`) REFERENCES `sys_menu` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=555 DEFAULT CHARSET=utf8;

