  `id` int(11) NOT NULL AUTO_INCREMENT,
  `last_update_time` datetime DEFAULT NULL,
  `visible` bit(1) DEFAULT NULL,
  `menu_id` int(11) NOT NULL,
  `role_id` int(11) NOT NULL,
  `insert_user` int(11) DEFAULT NULL,
  `last_update_user` int(11) DEFAULT NULL,
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  KEY `FKF6CF04649F3BD079` (`insert_user`),
  KEY `FKF6CF04641DCD6440` (`last_update_user`),
  CONSTRAINT `FKF6CF04641DCD6440` FOREIGN KEY (`last_update_user`) REFERENCES `sys_user` (`id`),
  CONSTRAINT `FKF6CF04649F3BD079` FOREIGN KEY (`insert_user`) REFERENCES `sys_user` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2246 DEFAULT CHARSET=utf8;

