/*Table structure for table `sys_oper_log` */

DROP TABLE IF EXISTS `sys_oper_log`;

CREATE TABLE `sys_oper_log` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `last_update_time` datetime DEFAULT NULL,
  `ip` varchar(32) NOT NULL,
  `oper_action` varchar(32) NOT NULL,
  `oper_content` longtext NOT NULL,
  `oper_result` varchar(8) NOT NULL,
  `oper_user` int(11) NOT NULL,
  `insert_user` int(11) DEFAULT NULL,
  `last_update_user` int(11) DEFAULT NULL,
  `oper_module` varchar(128) NOT NULL,
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  KEY `FK7971EB058606204` (`oper_user`),
  KEY `FK7971EB059F3BD079` (`insert_user`),
  KEY `FK7971EB051DCD6440` (`last_update_user`),
  CONSTRAINT `FK7971EB051DCD6440` FOREIGN KEY (`last_update_user`) REFERENCES `sys_user` (`id`),
  CONSTRAINT `FK7971EB058606204` FOREIGN KEY (`oper_user`) REFERENCES `sys_user` (`id`),
  CONSTRAINT `FK7971EB059F3BD079` FOREIGN KEY (`insert_user`) REFERENCES `sys_user` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=5115 DEFAULT CHARSET=utf8;

