新增','[\n	{\n		\"createTime\":1387776405000,\n		\"description\":\"周飞飞家测试\",\n		\"id\":2,\n		\"mac\":\"00-1F-64-E8-DD-1F\",\n		\"mall\":{\n			\"id\":1,\n			\"name\":\"世贸天阶\",\n			\"new\":false\n		},\n		\"new\":false\n	}\n]','成功',1,NULL,NULL,'无线AP设备','2013-12-23 13:27:10'),(3041,NULL,'114.253.99.220','修改','[\n	{\n		\"address\":\"世贸天阶位于北京市朝阳区光华路9号,地处东大桥路东侧。\",\n		\"backgroudAttachment\":{\n			\"id\":56,\n			\"new\":false\n		},\n		\"background\":\"attachment/2013-12-22/20131222124538715908.jpg\",\n		\"id\":1,\n		\"intro\":\"世贸天阶投资（北京）有限公司 THE PLACE INVESTMENT(BEIJING) CO.,LTD. 世贸天阶投资集团成立于1995年。公司成立伊始，便立足于改善居住环境、提高生活品味的项目建设，先后投资了广渠门、顺四条、芳草地、金茂公寓等项目，建立起了一支具有专业知识的投资、开发和管理队伍。现已发展成为以房地产开发为核心，融商业运营、物业管理、国际贸易等多元业务为一体的综合投资集团。\\r\\n\\r\\n    1999年是世贸天阶投资集团飞速发展的标志年。公司投资组建了北京奥中基业房地产开发有限公司，进行世贸国际公寓项目的开发。位于北京CBD区域的世贸国际公寓，是北京核心地段的高档外销精装公寓。由于户型和居室设计上采用了国际通行的线性平面布局，南北贯通，户户朝阳，使得“展柜世贸国际公寓”设计荣获建设部“创新风暴”全国住宅设计夺标活动金奖，同时被北京青年报评为2000年“最佳经典户型”。开盘六个月售出90%，创高档外销公寓销售记录新高，并获得客户们的一致好评。\\r\\n\\r\\n    2003年，世贸天阶投资集团斥巨资开发建设世贸天阶项目，由南北两翼休闲购物中心和两座5A写字楼组成，长250米宽30米的天幕凌空而起，同时兼具优雅豪华的展柜阶梯广场、半封闭型的步行街，在整个和谐的空间组合中，各种经典建筑元素令世贸天阶处处流露着高贵时尚的商业气息。世贸天阶旨在创造更加舒适的购物休闲天地和与众不同的购物新体验。该项目于2006年建成投入使用。是北京CBD区域内独具时尚品味、休闲娱乐、文化艺术气息和奥中品牌特色的高档综合时尚购物场所，被有识之士称为“梦开始的地方”。 \",\n		\"logo\":\"attachment/2013-12-22/20131222124532426110.jpg\",\n		\"logoAttachment\":{\n			\"id\":55,\n			\"new\":false\n		},\n		\"mallId\":\"FE0E17813FC849B3A7E975DDF8B2DFD8\",\n		\"name\":\"世贸天阶\",\n		\"new\":false,\n		\"phone\":\"010-65871188\"\n	}\n]','成功',1,NULL,NULL,'商场信息','2013-12-23 13:34:19'),(3042,NULL,'114.253.99.220','修改','[\n	{\n		\"address\":\"世贸天阶位于北京市朝阳区光华路9号,地处东大桥路东侧。\",\n		\"backgroudAttachment\":{\n			\"id\":56,\n			\"new\":false\n		},\n		\"background\":\"attachment/2013-12-22/20131222124538715908.jpg\",\n		\"id\":1,\n		\"intro\":\"世贸天阶投资（北京）有限公司 THE PLACE INVESTMENT(BEIJING) CO.,LTD. 世贸天阶投资集团成立于1995年。公司成立伊始，便立足于改善居住环境、提高生活品味的项目建设，先后投资了广渠门、顺四条、芳草地、金茂公寓等项目，建立起了一支具有专业知识的投资、开发和管理队伍。现已发展成为以房地产开发为核心，融商业运营、物业管理、国际贸易等多元业务为一体的综合投资集团。\\r\\n    世贸天阶旨在创