域。涵盖了300多家零售名店，30多家餐饮美食，20多家临水酒吧以及传奇时代影城、全明星滑冰俱乐部、BHG精品超市等丰富的选择。\",\n		\"logo\":\"attachment/2014-02-18/20140218164144953635.jpg\",\n		\"mallId\":\"B85B4CDF836840DDBB1750C3260089F8\",\n		\"name\":\"蓝色港湾\",\n		\"new\":false,\n		\"phone\":\"+86 10 59056663\"\n	}\n]','成功',1,NULL,NULL,'商场信息','2014-02-18 16:41:44'),(3812,NULL,'111.201.175.140','新增','[\n	{\n		\"clazz\":102,\n		\"contact\":\"\",\n		\"device\":{\n			\"id\":1,\n			\"new\":false\n		},\n		\"floor\":\"-1\",\n		\"hotline\":\"\",\n		\"id\":48,\n		\"image\":\"attachment/2014-02-19/20140219110542425994.jpg\",\n		\"intro\":\"大嘴猴Paul Homme是和Calvin Klein齐名的国际知名品牌。产品系列：服装、床上用品、睡衣、泳装、内衣、休闲装、苹果配件等等，品牌持有商为Hk Saatchi inc。\",\n		\"location\":\"\",\n		\"logo\":\"attachment/2014-02-19/20140219110542424207.png\",\n		\"mall\":{\n			\"id\":9,\n			\"new\":false\n		},\n		\"name\":\"大嘴猴\",\n		\"new\":false,\n		\"phone\":\"59056059\",\n		\"priority\":48,\n		\"shopUuid\":\"502CFAB4073046FFA93DAB1E1F02642E\",\n		\"sn\":\"\",\n		\"weixin\":\"\"\n	}\n]','成功',1,NULL,NULL,'商户信息','2014-02-19 11:05:42'),(3813,NULL,'111.201.175.140','新增','[\n	{\n		\"clazz\":102,\n		\"contact\":\"\",\n		\"device\":{\n			\"id\":1,\n			\"new\":false\n		},\n		\"floor\":\"-1\",\n		\"hotline\":\"\",\n		\"id\":48,\n		\"image\":\"attachment/2014-02-19/20140219110542425994.jpg\",\n		\"intro\":\"大嘴猴Paul Homme是和Calvin Klein齐名的国际知名品牌。产品系列：服装、床上用品、睡衣、泳装、内衣、休闲装、苹果配件等等，品牌持有商为Hk Saatchi inc。\",\n		\"location\":\"\",\n		\"logo\":\"attachment/2014-02-19/20140219110542424207.png\",\n		\"mall\":{\n			\"id\":9,\n			\"new\":false\n		},\n		\"name\":\"大嘴猴\",\n		\"new\":false,\n		\"phone\":\"59056059\",\n		\"priority\":48,\n		\"shopUuid\":\"502CFAB4073046FFA93DAB1E1F02642E\",\n		\"sn\":\"\",\n		\"weixin\":\"\"\n	}\n]','成功',1,NULL,NULL,'商户信息','2014-02-19 11:05:42'),(3814,NULL,'111.201.175.140','新增','[\n	{\n		\"device\":{\n			\"id\":1,\n			\"new\":false\n		},\n		\"id\":34,\n		\"new\":false,\n		\"shop\":{\n			\"clazz\":102,\n			\"contact\":\"\",\n			\"device\":{\"$ref\":\"$.null.device