:\"1\",\n		\"hotline\":\"2层-154\",\n		\"id\":55,\n		\"image\":\"attachment/2014-02-19/20140219132538592450.jpg\",\n		\"intro\":\"Harbor House品牌源于美国加州北部，被太平洋与Mendocino红木森林环绕的Harbor House度假别墅，坐落在宁静的海滩花园上，对望着浩渺无边的大海。 这座由著名设计师Louis Christian Mullgardt设计，始建于1916年的Harbor House以其无可复制的后花园海景、古朴大气的建筑风格、精美的红木艺术，被誉为美国20世纪初Arts and Craft时代最具代表性的建筑之一。\\r\\n    如今Mendocino海岸早已禁止了任何形式的开发与建筑，自然的生态将被永久的保护下去。 在这里，远离闹市的喧嚣，时间停下了它的脚步。在阳光满满的周末，你可以去海里冲浪；在Harbor House花园后面的海滩戏水；你可以与成群的海鸟为伴，观赏百米外迁游途中的鲸鱼群；你可以潜入神秘的海底森林，去采加州特有的红鲍鱼；你可以去周边浓香四溢的葡萄酒园品酒；你也可以带着家人去附近的红木森林露营，晚上围着暖暖的篝火，一起分享一天的快乐与收获。\\r\\n    今天，我们把Harbor House的生活方式介绍给我们的客人。 Harbor House的产品，在全球采购, 由顶尖设计师们创造, 但并不为贵重所累. 我们崇尚的是平价的奢华, 以超凡的价值及丰富的产品组合, 带给你完美的购物体验。\\r\\n    Harbor House是质朴从容的生活, 是人与自然的融合, 是无拘无束的自由。\",\n		\"location\":\"\",\n		\"logo\":\"attachment/2014-02-19/20140219132538592664.png\",\n		\"mall\":{\n			\"id\":9,\n			\"new\":false\n		},\n		\"name\":\"Harbor House\",\n		\"new\":false,\n		\"phone\":\"59051718\",\n		\"priority\":55,\n		\"shopUuid\":\"7DB89CF9B7AE45B7BAD3C1394E3A8546\",\n		\"sn\":\"\",\n		\"weixin\":\"\"\n	}\n]','成功',1,NULL,NULL,'商户信息','2014-02-19 13:25:38'),(3834,NULL,'111.201.175.140','新增','[\n	{\n		\"clazz\":111,\n		\"contact\":\"\",\n		\"device\":{\n			\"id\":1,\n			\"new\":false\n		},\n		\"floor\":\"1\",\n		\"hotline\":\"2层-154\",\n		\"id\":55,\n		\"image\":\"attachment/2014-02-19/20140219132538592450.jpg\",\n		\"intro\":\"Harbor House品牌源于美国加州北部，被太平洋与Mendocino红木森林环绕的Harbor House度假别墅，坐落在宁静的海滩花园上，对望着浩渺无边的大海。 这座由著名设计师Louis Christian Mullgardt设计，始建于1916年的Harbor House以其无可复制的后花园海景、古朴大气的建筑风格、精美的红木艺术，被誉为美国20世纪初Arts and Craft时代最具代表性的建筑之一。\\r\\n    如今Mendocino海岸早已禁止了任何形式的开发与建筑，自然的生态将被永久的保护下去。 在这里，远离闹市的喧嚣，时间停下了它的脚步。在阳光满满的周末，你可以去海里冲浪；在Harbor House花园后面的海滩戏水；你可以与成群的海鸟为伴，观赏百米外迁游途中的鲸鱼群；你可以潜入神秘的海底森林，去采加州特有的红鲍鱼；你可以去周边浓香四溢的葡萄酒园品酒；你也可以带着家人去附近的红木森林露营，晚上围着暖暖的篝火，一起分享一天的快乐与收获。\\r\\n    今天，我们把Harbor House的生活方式介绍给我们的客人。 Harbor House的产品，在全球采购, 由顶尖设计师们创造, 但并不为贵重所累. 我们崇尚的是平价的奢华, 以超凡的价值及丰富的产品组合, 带给你完美的购物体验。\\r\\n    Harbor House是质朴从容的生活, 是人