院、3000平米真冰滑冰俱乐部、并配以美容美发、健身、书店、牙科医院、健康管理品牌、中国老字号药店、银行等生活化服务项目。按不同的功能划分为SOLANA MALL、儿童城、品牌街、亮马食街、左岸、中央广场等区域。涵盖了300多家零售名店，30多家餐饮美食，20多家临水酒吧以及传奇时代影城、全明星滑冰俱乐部、BHG精品超市等丰富的选择。\",\n		\"logo\":\"attachment/2014-02-18/20140218164144953635.jpg\",\n		\"mallId\":\"B85B4CDF836840DDBB1750C3260089F8\",\n		\"name\":\"蓝色港湾\",\n		\"new\":false,\n		\"phone\":\"+86 10 59056663\",\n		\"shortName\":\"蓝色港湾\"\n	}\n]','成功',1,NULL,NULL,'商场信息','2014-02-25 00:03:10'),(3892,NULL,'127.0.0.1','修改','[\n	{\n		\"address\":\"朝阳北路\",\n		\"background\":\"C:\\\\fakepath\\\\300105.jpg\",\n		\"contact\":\"\",\n		\"enableWeixinLogin\":true,\n		\"id\":5,\n		\"intro\":\"综合百货\",\n		\"logo\":\"attachment/2014-02-14/20140214164619361768.jpg\",\n		\"mallId\":\"9014AE0DD8704538A9B3C968F7B9AED1\",\n		\"name\":\"朝阳大悦城\",\n		\"new\":false,\n		\"phone\":\"\",\n		\"shortName\":\"朝阳大悦城\"\n	}\n]','成功',1,NULL,NULL,'商场信息','2014-02-25 00:03:25'),(3893,NULL,'127.0.0.1','修改','[\n	{\n		\"address\":\"世贸天阶位于北京市朝阳区光华路9号,地处东大桥路东侧。\",\n		\"background\":\"attachment/2014-01-07/20140107175329039884.jpg\",\n		\"contact\":\"世贸天阶\",\n		\"enableWeixinLogin\":true,\n		\"id\":1,\n		\"intro\":\"    世贸天阶旨在创造更加舒适的购物休闲天地和与众不同的购物新体验。\",\n		\"logo\":\"attachment/2014-01-07/20140107175329036617.jpg\",\n		\"mallId\":\"FE0E17813FC849B3A7E975DDF8B2DFD8\",\n		\"name\":\"世贸天阶\",\n		\"new\":false,\n		\"phone\":\"010-65871188\",\n		\"shortName\":\"世贸天阶\"\n	}\n]','成功',1,NULL,NULL,'商场信息','2014-02-25 00:03:38'),(3894,NULL,'127.0.0.1','修改','[\n	{\n		\"address\":\"北京市朝阳区朝阳公园路6号\",\n		\"background\":\"attachment/2014-02-18/20140218164144953840.jpg\",\n		\"contact\":\"\",\n		\"enableWeixinLogin\":false,\n		\"id\":9,\n		\"intro\":\"蓝色港湾国际商区访遍全球购物中心，引入风靡全球的“Lifestyle Shopping Center”商业，并将其与北京消费趋势相结合，倾心打造中国首家Lifestyle Shopping Park。这里不仅是与国际潮流对接的时尚风向标，更是享受阳光湖水的购物天堂和欢聚空间。\\r\\n蓝色港湾国际商区拥有多个首次进入亚洲或中国的国际化时尚品牌，以快时尚为主导的零售版块融合中高端服装、服饰、珠宝及家居、户外品牌，为时尚人士提供多元化与全球潮流同步的购物选择。蓝色港湾儿童城是目前北京市针对儿童业态规划最完整、体量最大的0至12岁儿童一站式成长体验地，提供自孕妈妈开始的一系列服饰、用品、食品及保健品、玩具、早教、儿童餐饮、运动体验。涵盖中国菜、东南亚美食、美式、地中