厅影院、3000平米真冰滑冰俱乐部、并配以美容美发、健身、书店、牙科医院、健康管理品牌、中国老字号药店、银行等生活化服务项目。按不同的功能划分为SOLANA MALL、儿童城、品牌街、亮马食街、左岸、中央广场等区域。涵盖了300多家零售名店，30多家餐饮美食，20多家临水酒吧以及传奇时代影城、全明星滑冰俱乐部、BHG精品超市等丰富的选择。\",\n			\"logo\":\"attachment/2014-02-18/20140218164144953635.jpg\",\n			\"mallId\":\"B85B4CDF836840DDBB1750C3260089F8\",\n			\"name\":\"蓝色港湾\",\n			\"new\":false,\n			\"phone\":\"+86 10 59056663\",\n			\"shortName\":\"蓝色港湾\"\n		},\n		\"new\":false,\n		\"shop\":{\n			\"class1\":{\n				\"des\":\"男装\",\n				\"id\":1,\n				\"isDel\":false,\n				\"name\":\"男装\",\n				\"new\":false\n			},\n			\"contact\":\"范伟\",\n			\"hotline\":\"\",\n			\"id\":64,\n			\"image\":\"attachment/2014-02-24/20140224134950217903.jpg\",\n			\"intro\":\"“饭前也想你，饭后还想你，饭前饭后更想你”——饭前饭后—座落在600年历史文化古迹里，“南新仓”皇家粮仓群，传承历史与现代交错的空间，美食亦是如此。\",\n			\"location\":\"\",\n			\"logo\":\"attachment/2014-02-24/20140224134950217409.jpg\",\n			\"mall\":{\"$ref\":\"$.null.mall\"},\n			\"name\":\"饭前饭后\",\n			\"new\":false,\n			\"phone\":\"01064059598\",\n			\"priority\":64,\n			\"shopUuid\":\"A4A92E11C5DA4F848373D76346E0CC31\",\n			\"sn\":\"\",\n			\"weixin\":\"饭前饭后更想你\"\n		},\n		\"status\":0,\n		\"type\":1\n	}\n]','成功',1,NULL,NULL,'商铺排队设置','2014-02-25 09:48:06'),(3924,NULL,'124.207.115.68','修改','[\n	{\n		\"callType\":1,\n		\"id\":6,\n		\"interval\":15,\n		\"isCall\":1,\n		\"mall\":{\n			\"address\":\"北京市朝阳区朝阳公园路6号\",\n			\"background\":\"attachment/2014-02-18/20140218164144953840.jpg\",\n			\"contact\":\"\",\n			\"createTime\":1392712904000,\n			\"enableWeixinLogin\":true,\n			\"id\":9,\n			\"intro\":\"蓝色港湾国际商区访遍全球购物中心，引入风靡全球的“Lifestyle Shopping Center”商业，并将其与北京消费趋势相结合，倾心打造中国首家Lifestyle Shopping Park。这里不仅是与国际潮流对接的时尚风向标，更是享受阳光湖水的购物天堂和欢聚空间。\\r\\n蓝色港湾国际商区拥有多个首次进入亚洲或中国的国际化时尚品牌，以快时尚为主导的零售版块融合中高端服装、服饰、珠宝及家居、户外品牌，为时尚人士提供多元化与全球潮流同步的购物选择。蓝色港湾儿童城是目前北京市针对儿童业态规划最完整、体量最大的0至12岁儿童一站式成长体验地，提供自孕妈妈开始的一系列服饰、用品、食品及保健品、玩具、早教、儿童餐饮、运动体验。涵盖中国菜、东南亚美食、美式、地中海系列菜系、和式等美食体验的餐饮业态为全北京的美食爱好者提供来自世界各地的传统美食、新派菜系、休闲餐饮。并以全天候6餐段为食客提供上佳服务，各家餐厅均临近湖畔或水岸，美食与美景相得益彰。我们还为顾客提供豪华8厅影院、3000平米真冰滑冰俱乐部、并配