":15,\n		\"status\":1,\n		\"uuid\":\"08F476AC623E4770B12D890F0AA28A14\"\n	}\n]','成功',14,NULL,NULL,'商铺促销活动','2014-02-25 20:26:45'),(4747,NULL,'124.207.115.68','修改','[\n	{\n		\"authorityName\":\"ROLE_MALL_SHOPPROMOTION_SUBMITAUDIT\",\n		\"external\":0,\n		\"icon\":\"fa fa-star\",\n		\"id\":367,\n		\"menuDesc\":\"商户促销活动-提交审核\",\n		\"menuName\":\"/mall/shopPromotion/submitAudit\",\n		\"menuType\":\"3\",\n		\"new\":false,\n		\"parentId\":{\n			\"authorityName\":\"ROLE_MALL_SHOPPROMOTION_LIST\",\n			\"enabled\":\"1\",\n			\"external\":0,\n			\"icon\":\"fa fa-hand-o-right\",\n			\"id\":299,\n			\"menuDesc\":\"商铺促销活动\",\n			\"menuName\":\"/mall/shopPromotion/list\",\n			\"menuSeq\":3,\n			\"menuType\":\"2\",\n			\"new\":false,\n			\"parentId\":{\n				\"enabled\":\"1\",\n				\"icon\":\"fa fa-sitemap\",\n				\"id\":313,\n				\"menuDesc\":\"基础资源管理\",\n				\"menuSeq\":0,\n				\"menuType\":\"1\",\n				\"new\":false,\n				\"summary\":\"基础资源管理\",\n				\"target\":\"navTab\",\n				\"visible\":\"1\"\n			},\n			\"summary\":\"商户促销活动\",\n			\"visible\":\"1\"\n		},\n		\"summary\":\"商户促销活动-提交审核\",\n		\"target\":\"navTab\",\n		\"visible\":\"1\"\n	}\n]','成功',1,NULL,NULL,'菜单','2014-02-25 20:53:20'),(4748,NULL,'124.207.115.68','修改','[\n	{\n		\"authorityName\":\"ROLE_MALL_SHOPPROMOTION_AUDIT\",\n		\"external\":0,\n		\"icon\":\"fa fa-star\",\n		\"id\":352,\n		\"menuDesc\":\"商户促销活动-审核\",\n		\"menuName\":\"/mall/shopPromotion/audit\",\n		\"menuSeq\":9,\n		\"menuType\":\"3\",\n		\"new\":false,\n		\"parentId\":{\n			\"authorityName\":\"ROLE_MALL_SHOPPROMOTION_LIST\",\n			\"enabled\":\"1\",\n			\"external\":0,\n			\"icon\":\"fa fa-hand-o-right\",\n			\"id\":299,\n			\"menuDesc\":\"商铺促销活动\",\n			\"menuName\":\"/mall/shopPromotion/list\",\n			\"menuSeq\":3,\n			\"menuType\":\"2\",\n			\"new\":false,\n			\"parentId\":{\n				\"enabled\":\"1\",\n				\"icon\":\"fa fa-sitemap\",\n				\"id\":313,\n				\"menuDesc\":\"基础资源管理\",\n				\"menuSeq\":0,\n				\"menuType\":\"1\",\n				\"new\":false,\n				\"summary\":