  CONSTRAINT `FK74A6B2A81DCD6440` FOREIGN KEY (`last_update_user`) REFERENCES `sys_user` (`id`),
  CONSTRAINT `FK74A6B2A89F3BD079` FOREIGN KEY (`insert_user`) REFERENCES `sys_user` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8;

