/* Procedure structure for procedure `count_day_data` */

/*!50003 DROP PROCEDURE IF EXISTS  `count_day_data` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` PROCEDURE `count_day_data`()
BEGIN
	#宣传页展示数 PV
	start TRANSACTION;
 

	
	insert into com_report_day
  (date , pv ,uv,shop_id) 

	select DATE_ADD(date(NOW()),INTERVAL  -1 DAY),count(1),count(DISTINCT term_mac),shop_uuid from com_stat_show where resource_id=1 and date(stat_time) = DATE_ADD(date(NOW()),INTERVAL  -1 DAY) GROUP BY shop_uuid;
  COMMIT;
	
	
END */$$
DELIMITER ;

/* Procedure structure for procedure `count_fresh_data` */

/*!50003 DROP PROCEDURE IF EXISTS  `count_fresh_data` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `count_fresh_data`()
BEGIN
	#宣传页展示数 PV
	start TRANSACTION;
  delete from com_report_fresh where type = 2;
	insert into com_report_fresh 
  ( type , count ,shop_uuid) 
	select 2,count(1),shop_uuid from com_stat_show where resource_id=1 and date(stat_time) = date(NOW()) GROUP BY shop_uuid;
  COMMIT;
	
	#无线网络客流量（UV）
	start TRANSACTION;
  delete from com_report_fresh where type = 3;
	insert into com_report_fresh 
  ( type , count ,shop_uuid) 
	select 3,count(DISTINCT term_mac),shop_uuid from com_stat_show where resource_id=1 and date(stat_time) = date(NOW()) GROUP BY shop_uuid;
  COMMIT;

	#当天注册用户数
	start TRANSACTION;
  delete from com_report_fresh where type = 4;
	insert into com_report_fresh 
  ( type , count ) 
	select 4,count(1) from com_customer where date(create_time) = date(NOW());
  COMMIT;

  #注册用户总数
	start TRANSACTION;
  delete from com_report_fresh where type = 5;
	insert into com_report_fresh 
  ( type , count ) 
	select 5,count(1) from com_customer;
  COMMIT;

	#当天新增用户数 每个商户
	start TRANSACTION;
  delete from com_report_fresh where type = 6;
	insert into com_report_fresh 
  ( type , count ,shop_id) 
	select 6,count(1) ,r.shop_id from com_customer_relation r where  date(r.create_time) = date(NOW()) GROUP BY r.shop_id ;
  COMMIT;

  #用户总数 每个商户
	start TRANSACTION;
  delete from com_report_fresh where type = 7;
	insert into com_report_fresh 
  ( type , count ,shop_id) 
	select 7,count(1),r.shop_id from com_customer_relation r GROUP BY r.shop_id ;
  COMMIT;
	
	
END */$$
DELIMITER ;

/* Procedure structure for procedure `count_hour_data` */

/*!50003 DROP PROCEDURE IF EXISTS  `count_hour_data` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `count_hour_data`()
BEGIN
	#更新每时段在线人数统计数据
  declare i int;
  DECLARE n int;
	start TRANSACTION;
		DELETE from com_report_hour where date = date(NOW());
    set i=8;
    set n = HOUR(NOW());
    while i<= n do
       insert into com_report_hour
       ( time , online_user_count ,date) 
			 SELECT CONCAT(i,':00'),count(DISTINCT term_mac),date(NOW()) from com_user_log where date(online_time) = date(NOW()) and   (HOUR(online_time) <= i and HOUR(offline_time) >= i );		
			 insert into com_report_hour
       ( time , online_user_count ,date) 
			 SELECT CONCAT(i,':30'),count(DISTINCT term_mac),date(NOW()) from com_user_log where date(online_time) = date(NOW()) and   (time(online_time) <= CONCAT(i,':30:00') and time(offline_time) >= CONCAT(i,':30:00')  );		
		set i=i+1;
		end while;
  COMMIT;
END */$$
DELIMITER ;

/* Procedure structure for procedure `stat_mall_by_day` */

/*!50003 DROP PROCEDURE IF EXISTS  `stat_mall_by_day` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` PROCEDURE `stat_mall_by_day`()
BEGIN
  #宣传页展示数 PV
  START TRANSACTION ;
  INSERT INTO com_stat_mall (mall_id, pv, DATE) 
  SELECT 
    mall_id,
    COUNT(1),
    DATE_ADD(DATE(NOW()), INTERVAL - 1 DAY) 
  FROM
    com_stat_show 
  WHERE DATE(stat_time) = DATE_ADD(DATE(NOW()), INTERVAL - 1 DAY) 
  GROUP BY mall_id ;
  COMMIT ;
END */$$
DELIMITER ;

